const peopleReducer = (state = initialState, action) => {
  switch (action.type) {
    case FOLLOW:
      return {
        ...state,
        people: state.people.map((u) => {
          if (u.id === action.id) {
            return { ...u, friend: true };
          }
          return u;
        })
      };
    case UNFOLLOW:
      return {
        ...state,
        people: state.people.map((u) => {
          if (u.id === action.id) {
            return { ...u, friend: false };
          }
          return u;
        })
      };
    case SETUSERS: {
      return { ...state, people: action.people };
    }
    case SETCURRENTPAGE:
      return { ...state, currentPage: action.currentPage };
    default:
      return state;
  }
};

export const currentPageActionCreater = (currentPage) => ({
  type: SETCURRENTPAGE,
  currentPage
});

export const followActionCreater = (id) => ({
  type: FOLLOW,
  id
});

export const unfollowActionCreator = (id) => ({
  type: UNFOLLOW,
  id
});

export const setUsersActionCreator = (people) => ({
  type: SETUSERS,
  people
});

export default peopleReducer;
